var title_f35_59_36787="Factors for TIMI grade flow";
var content_f35_59_36787=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52322&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52322&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 500px\">",
"   <div class=\"ttl\">",
"    Schematic of factors potentially influencing TIMI grade flow",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 480px; height: 356px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There are a number of factors, acting in concert, that determine the patency of the coronary artery after thrombolysis; these include hemodynamics, local artery anatomy, the thrombus, cellular mechanisms, and procedural issues. The TIMI flow grade, which has been determined at various points in time after thrombolysis, correlates with mortality after the infarction. (With permission from Tan WA, Noliterno DJ. Am Heart J 1998; 136:570).",
"    <div class=\"footnotes\">",
"     <br>",
"      *DPB=diastolic blood pressure, EDP=left ventricular end-diastolic pressure",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
